-- ----------------------------
-- Table structure for roles
-- ----------------------------
DROP TABLE IF EXISTS `roles`;
CREATE TABLE `roles`  (
  `name` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '角色名称',
  `role_code` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '角色编码',
  `role_type` int NOT NULL COMMENT '权限类型，10菜单权限，20用户组权限',
  `menus` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL COMMENT '菜单列表（逐步废弃，使用role_menu表）',
  `description` varchar(500) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '描述',
  `status` int NULL DEFAULT NULL COMMENT '状态 10 启用 20 禁用',
  `dept_id` int NULL DEFAULT NULL COMMENT '部门ID',
  `data_scope` int NULL DEFAULT NULL COMMENT '数据权限范围 1全部 2本部门 3本部门及下级 4仅本人',
  `sort` int NULL DEFAULT NULL COMMENT '排序',
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键',
  `creation_date` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `created_by` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `updation_date` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `updated_by` bigint NULL DEFAULT NULL COMMENT '更新人ID',
  `enabled_flag` tinyint(1) NOT NULL COMMENT '是否删除, 0 删除 1 非删除',
  `trace_id` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT 'trace_id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ix_roles_name`(`name` ASC) USING BTREE,
  INDEX `ix_roles_role_code`(`role_code` ASC) USING BTREE,
  INDEX `ix_roles_role_type`(`role_type` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = Dynamic;

