  INDEX `ix_user_login_record_login_type`(`login_type` ASC) USING BTREE,
  INDEX `ix_user_login_record_code`(`code` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 34 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

